import React from "react";

// reactstrap components
import { Card, CardHeader, CardBody, Row, Col } from "reactstrap";


function Home() {
  return (
    <>
      <div className="content">
        <Row>
          <Col md="12">
            <Card className="card-plain">
              <CardHeader>Mais vendidos</CardHeader>
            </Card>
          </Col>
        </Row>
      </div>
    </>
  );
}

export default Home;
